import React from "react";
import bgImage from "../assets/image.png"; // Remplace par ton image

const Login = () => {
  return (
    <div style={{width: 1280, height: 832, position: 'relative', background: '#F5EFE6'}}>
    <img style={{width: 634, height: 832, left: 0, top: 0, position: 'absolute', opacity: 0.70}} src="https://placehold.co/634x832" />
    <div style={{width: 393, height: 94, left: 766, top: 201, position: 'absolute', textAlign: 'center', color: '#2D0C57', fontSize: 34, fontFamily: 'Roboto Flex', fontWeight: '700', lineHeight: 41, letterSpacing: 0.41, wordWrap: 'break-word'}}>Reducing Waste, Saving Taste !</div>
    <div style={{width: 469, height: 66, paddingLeft: 70.98, paddingRight: 70.98, paddingTop: 18.86, paddingBottom: 18.86, left: 728, top: 592, position: 'absolute', background: '#4F6F52', borderRadius: 8, justifyContent: 'center', alignItems: 'center', display: 'inline-flex'}}>
        <div style={{width: 327.03, height: 28.29, textAlign: 'center', color: 'white', fontSize: 15, fontFamily: 'Roboto', fontWeight: '600', textTransform: 'uppercase', lineHeight: 18, wordWrap: 'break-word'}}>LOGIN</div>
    </div>
    <div style={{width: 469, height: 55, left: 728, top: 378, position: 'absolute'}}>
        <div style={{width: 469, height: 55, left: 0, top: 0, position: 'absolute', background: 'white', borderRadius: 27, border: '1px #D9D0E3 solid'}} />
        <div style={{width: 363.66, height: 27.50, left: 77.75, top: 13.75, position: 'absolute', color: '#9586A8', fontSize: 17, fontFamily: 'Roboto', fontWeight: '400', lineHeight: 22, wordWrap: 'break-word'}}>Username</div>
    </div>
    <div style={{width: 469, height: 55, left: 728, top: 468, position: 'absolute'}}>
        <div style={{width: 469, height: 55, left: 0, top: 0, position: 'absolute', background: 'white', borderRadius: 27, border: '1px #D9D0E3 solid'}} />
        <div style={{width: 363.66, height: 27.50, left: 77.75, top: 13.75, position: 'absolute', color: '#9586A8', fontSize: 17, fontFamily: 'Roboto', fontWeight: '400', lineHeight: 22, wordWrap: 'break-word'}}>Password</div>
    </div>
    <img style={{width: 417, height: 159, left: 745, top: 42, position: 'absolute'}} src="https://placehold.co/417x159" />
</div>

  );
};

export default Login;
